import React, { useState } from 'react';

const AIFinancialAnalysis = ({ expenses = [], savings = [] }) => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchAIAnalysis = async () => {
    setIsLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:11434/api/generate', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          model: 'llama3.2:3b-instruct-q8_0',
          system: "Eres un analista financiero que SOLO responde en formato JSON. No agregues texto explicativo ni comentarios.",
          prompt: `RETORNA ÚNICAMENTE UN OBJETO JSON CON EL SIGUIENTE ANÁLISIS FINANCIERO:

gastosTotales: La suma numérica de los montos en expenses
ahorrosTotales: La suma numérica de los montos en savings
analisisGastos: Un texto analizando los patrones de gasto
progresoAhorros: Un texto analizando el progreso de ahorro
recomendaciones: Un array de 3 recomendaciones específicas
categoriasMayorGasto: Un array con las categorías que más gastos tienen
potencialAhorro: Una estimación numérica de ahorro potencial

Datos para analizar:
expenses = ${JSON.stringify(expenses)}
savings = ${JSON.stringify(savings)}`
        })
      });

      const data = await response.json();
      console.log('Respuesta cruda:', data.response);

      // Buscar el JSON en la respuesta
      const jsonMatch = data.response.match(/\{[\s\S]*\}/);
      if (!jsonMatch) {
        throw new Error('No se encontró un JSON válido en la respuesta');
      }

      const jsonStr = jsonMatch[0];
      console.log('JSON extraído:', jsonStr);

      const parsedData = JSON.parse(jsonStr);
      setAiInsights(parsedData);
    } catch (error) {
      console.error('Error completo:', error);
      setError('Error al procesar el análisis. Por favor, intenta de nuevo.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="p-4 space-y-6 bg-white rounded-lg shadow">
      <button
        onClick={fetchAIAnalysis}
        disabled={isLoading}
        className={`w-full py-3 px-4 rounded-lg text-white font-medium transition-colors ${
          isLoading ? 'bg-gray-400' : 'bg-blue-600 hover:bg-blue-700'
        }`}
      >
        {isLoading ? 'Analizando...' : 'Obtener Análisis'}
      </button>

      {error && (
        <div className="p-4 bg-red-50 border border-red-200 rounded-lg text-red-700">
          {error}
        </div>
      )}

      {aiInsights && (
        <div className="space-y-6">
          <div className="grid grid-cols-2 gap-4">
            <div className="p-4 bg-blue-50 rounded-lg">
              <p className="text-sm text-blue-600 font-semibold">Gastos Totales</p>
              <p className="text-2xl font-bold">
                {Number(aiInsights.gastosTotales).toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
            <div className="p-4 bg-green-50 rounded-lg">
              <p className="text-sm text-green-600 font-semibold">Ahorros Totales</p>
              <p className="text-2xl font-bold">
                {Number(aiInsights.ahorrosTotales).toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
          </div>

          <div className="space-y-4">
            <div className="border-b pb-4">
              <h3 className="font-semibold text-lg mb-2">Análisis de Gastos</h3>
              <p className="text-gray-700">{aiInsights.analisisGastos}</p>
            </div>

            <div className="border-b pb-4">
              <h3 className="font-semibold text-lg mb-2">Progreso de Ahorros</h3>
              <p className="text-gray-700">{aiInsights.progresoAhorros}</p>
            </div>

            <div className="border-b pb-4">
              <h3 className="font-semibold text-lg mb-2">Categorías con Mayor Gasto</h3>
              <div className="flex flex-wrap gap-2">
                {aiInsights.categoriasMayorGasto.map((categoria, index) => (
                  <span 
                    key={index}
                    className="px-3 py-1 bg-gray-100 rounded-full text-sm text-gray-700"
                  >
                    {categoria}
                  </span>
                ))}
              </div>
            </div>

            <div>
              <h3 className="font-semibold text-lg mb-2">Recomendaciones</h3>
              <ul className="space-y-2">
                {aiInsights.recomendaciones.map((rec, index) => (
                  <li 
                    key={index}
                    className="flex items-start"
                  >
                    <span className="mr-2">•</span>
                    <span className="text-gray-700">{rec}</span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
